{
    "title": "程煜的学术与技术成就社群",
    "summary": "该社群以程煜及其关联的学术与技术成就为核心，涉及多个学科、活动和证书。程煜是江西师范大学在读本科生，专业为计算机科学与技术，并且在多个国家及省级竞赛中取得了优异成绩。主要研究领域包括知识图谱、提示学习、预训练语言模型和程序分析。在学术上，发表论文并获得多项学术奖励与证书。",
    "rating": 8.7,
    "rating_explanation": "该社群的影响力较大，因程煜在国际和国家级竞赛中所取得的成绩和发表的学术论文。",
    "findings": [
        {
            "summary": "程煜在学术研究与技术实践方面取得了显著成就",
            "explanation": "程煜是江西师范大学计算机科学与技术专业的在读本科生，在学术上表现非常优秀 [Data: L0_C0 (c0fca162-029c-4b97-867d-fd138f497069)]. 他在知识图谱、提示学习、预训练语言模型以及程序分析等领域进行研究，并同时在黄箐教授和澳大利亚国立大学的邢振昌教授的联合指导下进行科研工作 [Data: L0_C0 (c0fca162-029c-4b97-867d-fd138f497069)]. 程煜的研究成果包括他所发表的论文《Prompt Sapper: A LLM-Empowered Production Tool for Building AI Chains》[Data: L0_C0 (c0fca162-029c-4b97-867d-fd138f497069)]."
        },
